import React from "react";

const About = () => {
   return (
      <div>
         <h1>
            BrainBox is an educational and party game toolbox.
         </h1>
         <h1>
            It is created by Megan, Kiera, Hayden, Nic, and Evans in the University of Alabama Capstone Computing class.
         </h1>
      </div>
   );
};

export default About;
